import React from 'react';
import s from './Sidebar.module.css';
import Sidebarfriends from "./Sidebarfriends/Sidebarfriends";

const Sidebar = (props) => {

   alert(props.state.length);
    let threefriends = props.state.map((d) => <Sidebarfriends name={d.name} id={d.id} ava={d.ava}/>)
    return (
            <div>
                FRIENDS
                {threefriends}
            </div>
    )
}

export default Sidebar;
